import NewElementMarker from "../../shared/components/NewElementMarker"

const PromoElement = ({classNamePrefix ,newElement, title, deck, icon}) => {
    return (
        <li className={`promo-elements--${classNamePrefix}`}>
            {newElement ? <NewElementMarker></NewElementMarker> : ""}
            <div className="offers-item">
                <div className="offers-item__content">
                    <h3 className="offers-item__title">{title}</h3>
                    <a className="offers-item__link" href="link">{deck}</a>
                </div>
                <div className="promo-offers-item-img-wrapper">
                    {icon}
                </div>
            </div>
        </li>
    )
}

export default PromoElement
